import './App.css';
import NavBar from './NavBar';
import react, { useState } from 'react';


import BulletinContainer from './BulletinContainer';

import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

function AuthenticatedApp({ currentMember, setCurrentMember }){

  const [showBulletin, setShowBulletin] = useState ([])


    const navigate = useNavigate()

    // console log to test whether we're inside member session
    console.log("made it")  

    const handleLogout = () => {
        fetch(`/logout`, {
          method: 'DELETE',
          credentials: 'include'
        })
        .then(res => {
          if (res.ok) {
            setCurrentMember(null)
            navigate('/', {replace:false})
          }
        })
      }

    return(
      <div>
        <NavBar />
        <BulletinContainer showBulletin={showBulletin} setShowBulletin={setShowBulletin}/>
      </div>
    )

}

export default AuthenticatedApp
